package array_Declaration;

public class StudentReference_Array {
	int roll_No;
	String name;

	public StudentReference_Array(int roll_No, String name) {
		super();
		this.roll_No = roll_No;
		this.name = name;
	}

	public StudentReference_Array() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getRoll_No() {
		return roll_No;
	}

	public void setRoll_No(int roll_No) {
		this.roll_No = roll_No;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

}
